(2, 'star plus', 'StarPlus is an Indian pay television channel owned by Star India. The network\'s programming consists of family dramas, comedies, youth-oriented reality shows, shows on crime and television films. It is also distributed internationally by The Walt Disney Company India, subsidiary of The Walt Disney Company.', 'startplus.jpg', 'http://gotstar.divinetechs.com/assets/images/channel/starplus.mp4', 14, 'enable'),
