(5, 'HBO', 'HBO (Home Box Office) is a U.S. premium cable and satellite television network owned by AT&T\'s WarnerMedia. The programming featured on the network consists primarily of theatrically released motion pictures and original television shows, along with made-for-cable movies, documentaries and occasional comedy and concert specials.', 'hbo.jpeg', 'http://gotstar.divinetechs.com/assets/images/channel/hbo.mp4', 8, 'enable'),
